// src/Components/Footer.js
import React from 'react';
import { Typography } from '@material-tailwind/react';

const LINKS = [
  {
    title: 'Product',
    items: ['Overview', 'Features', 'Solutions', 'Tutorials'],
  },
  {
    title: 'Company',
    items: ['About Us', 'Careers', 'Press', 'News'],
  },
  {
    title: 'Resource',
    items: ['Blog', 'Newsletter', 'Events', 'Help Center'],
  },
];

const currentYear = new Date().getFullYear();

function Footer() {
  return (
    <footer className="relative w-full bg-gray-800 text-white py-6">
      <div className="mx-auto w-full max-w-7xl px-8">
        <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
          <Typography variant="h5" className="mb-6">
            My Website
          </Typography>
          {LINKS.map(({ title, items }) => (
            <ul key={title} className="space-y-3">
              <Typography
                variant="small"
                color="blue-gray"
                className="font-medium opacity-70"
              >
                {title}
              </Typography>
              {items.map((link) => (
                <li key={link}>
                  <Typography
                    as="a"
                    href="#"
                    color="gray"
                    className="py-1.5 font-normal transition-colors hover:text-gray-400"
                  >
                    {link}
                  </Typography>
                </li>
              ))}
            </ul>
          ))}
        </div>
        <div className="mt-12 flex flex-col items-center justify-between border-t border-gray-700 py-4 md:flex-row md:items-center md:justify-between">
          <Typography
            variant="small"
            className="mb-4 text-center font-normal text-gray-400 md:mb-0"
          >
            &copy; {currentYear} My Website. All Rights Reserved.
          </Typography>
          <div className="flex gap-4 text-gray-400">
            <Typography as="a" href="#" className="opacity-80 transition-opacity hover:opacity-100">

            </Typography>
            <Typography as="a" href="#" className="opacity-80 transition-opacity hover:opacity-100">

            </Typography>
          </div>
        </div>
      </div>
    </footer>
  );
}

export default Footer;
